import React from "react";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";

export default function Details() {
  const options = {
    chart: {
      type: "column"
    },
    title: {
      text: null
    },
    accessibility: {
      announceNewData: {
        enabled: true
      }
    },
    xAxis: {
      type: "category"
    },
    yAxis: {
      title: {
        text: null
      }
    },
    legend: {
      enabled: false
    },

    series: [
      {
        name: "Watt forbrug",
        colorByPoint: true,
        data: [
          {
            name: "00",
            y: 62.74
          },
          {
            name: "01",
            y: 10.57
          },
          {
            name: "02",
            y: 7.23
          },
          {
            name: "03",
            y: 5.58
          },
          {
            name: "04",
            y: 4.02
          },
          {
            name: "05",
            y: 1.92
          },
          {
            name: "06",
            y: 7.62
          }
        ]
      }
    ]
  };
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Detaljer</h1>
        <div className="card" style={{ overflow: "hidden", width: "50%" }}>
          <div className="card-body">
            <HighchartsReact highcharts={Highcharts} options={options} />
          </div>
        </div>
      </div>
    </div>
  );
}
